			for(j=0; j<ccs.length; j++) {
				this['cc_'+j].alpha = 1;
			}
			this.rotation = Math.random()*360;
			this.bgr_alph = Math.random()*0.1
			this.o_alph = 0.45+(Math.random()*0.1);
